import './ExpensiveItem.css';


function Expensive (props){
   
    return (
       <div className="expense-item">
         <div>{props.date}</div>
         <div className="expense-item__description">
             <h2> {props.title}</h2>
             <div className='expense-item__price'>${props.amout}</div>
         </div>
       </div>
    );
       
}

export default Expensive;
